import React from 'react';
import RecentEventsHeader from './RecentEventsHeader.jsx';
import EventCards from './EventCards.jsx';
import EventSliderPagination from './EventSliderPagination.jsx';

function RecentEventsSection(prop) {
    return (
<section className="py-16 xl:py-32"
><div
  ><div className="w-full"
    ><div className="w-full relative"
      ><RecentEventsHeader
      /><EventCards
      /><EventSliderPagination
      /></div
      ></div
    ></div
  ></section
>
);
}
export default RecentEventsSection;
